This gun is like 99% condition. Fired a few times and cleaned up like new and just been sitting in the safe to long. It's an IAB and just as it came out the box. .54 cal. Percussion. 
You won't find a gun this minty anywhere for $499.99 =}

New ones are $875 !!!

